import React from "react";
import { Route, Redirect } from "react-router-dom";

export const PrivateRoute = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={() => {
        if (localStorage.getItem("authToken")) {
          return <Component />;
        }
        return <Redirect to="/login" />;
      }}
    />
  );
};
